import './App.css';
import { Header } from './UI/Components/header/Header';
import { Body } from './UI/Components/body/Body';
import { Footer } from './UI/Components/footer/Footer';
require("dotenv").config();

function App() {
  return (
    <div className="App">
      <Header />
      <Body />
      <Footer />
    </div>
  );
}

export default App;
